import React from 'react'
import './Intro.css'

import BG from '../../video-bg.mp4';

const Intro = () => {
    return (
        <div class="intro">
            <video autoPlay loop muted style={{ opacity: "0.3", width: "100%" }}>
        <source src={BF} type="video/mp4" />
      </video>
        </div>
    )
}

export default Intro
